CREATE TRIGGER notifStock BEFORE UPDATE ON producto
  FOR EACH ROW
  BEGIN
    IF NEW.cantidadtotal <= 0 THEN
        INSERT INTO notif (mensaje,fecha, id_producto) VALUES (concat('Se acabo el stock de ',NEW.nombre), now() , new.id_producto);
  END IF;
  END;
